const Form = () => {

  const onSubmitHandler = (e) => {
    e.preventDefault();
    fetch('/api/email', {
      method: 'POST',
      headers: {
        'Content-type': 'application/json',
      },
      body: JSON.stringify({ message: 'test messate'}),
    });
  }
  return (
    <form className="form" onSubmit={onSubmitHandler}>
      <label>
        Сообющение:
        <input type="text" name="message"></input>
      </label>

      <button type="submit">Отправить</button>
      <style jsx>{`
        form {
          padding: 20px 0;
          display: flex;
          flex-direction: column;
          align-items: center;
        }
      `}</style>
    </form>
  )
}

export default Form;
